import React from 'react';
import { NavLink } from 'react-router-dom';

const Footer = () => {
  return (
    <div className="footer">
      <div className='socialIcons'>
        <span className='icon icLi'>LinkedIn</span>
        <span className='icon icGi'>GitHub</span>
      </div>
    </div>
  );
}

export default Footer;
